    }

    return (
        <>
            <Container
            maxWidth="xs"
            sx={{
                height: "100vh", // Ensure full height
                width: "100%", // Full width
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                backgroundColor: "lightblue", // Background color to fill the viewport
            }}>
                <Box sx={{
                    mt: 20,
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center"
                }}
                >
                    <Typography variant="h5">Login</Typography>
                    <TextField
                        margin="normal"
                        required
                        fullWidth
                        id="username"
                        label="Username"
                        name="username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="password"
                            name="password"
                            label="Password"
                            type="password"
                            value={password}
                            onChange={(e) => {
                            setPassword(e.target.value);
                            }}
                        />
                        <Link to="Dashboard">
                            <Button
                                fullWidth
                                variant="contained"
                                sx={{ mt: 3, mb: 2 }}
                                onClick={handleLogin}
                            >Login
                            </Button>
                        </Link>
                        <Link to="SignUp">Sign Up</Link>
                    </Box>
                </Container>
            </>
        )
    }

    export default Login
